import React from "react";
import Header from "../components/Header";

const Layout = () => {
  return (
    <div>
      <ul className="navbar">
        <Link to="/activities">
          <li>Activities</li>
        </Link>
        <Link to="/stats">
          <li>Stats</li>
        </Link>
      </ul>
    </div>
  );
};

export default Layout;
